import React from "react";

export default function Header(props) {
    return (
        <div className="meme__header">
            <div meme__header--nav>
                <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRXdtQ7vH2vak7mlWwZMApPOGAF8mgQXq7m5w&usqp=CAU" alt="meme-icon" />
                <ul>
                    <li><a href="#">Home</a></li>
                    <li><a href="#">About</a></li>
                </ul>
            </div>
        </div>
    )
}
